## üé¨ Feature Request: Product Video Reel Upload Support

### Overview
Implement support for uploading and managing TikTok/Instagram Reel style product videos in the admin dashboard. This feature will allow administrators to upload short-form vertical videos for products that can be displayed in a mobile-friendly video carousel format.

### Background
The backend API already supports product videos with the `ProductVideo` model and comprehensive admin endpoints. We need to update the admin dashboard to provide UI for uploading and managing these videos.

## üìã Requirements

### 1. Video Upload Interface
- Add a new "Videos" tab in the Product Form component
- Support multiple video uploads per product
- Display video thumbnails/previews after upload
- Allow drag-and-drop reordering of videos
- Support setting a primary/featured video
- Include fields for:
  - Video title
  - Description
  - Duration (auto-detected)
  - Display order
  - Is featured flag
  - Is active flag

### 2. Video Specifications
- **Format Support**: MP4, MOV, WebM
- **Orientation**: Vertical (9:16 aspect ratio preferred)
- **Max Size**: 100MB per video
- **Max Duration**: 60 seconds (TikTok/Reel style)
- **Resolution**: Minimum 720x1280, Maximum 1080x1920

### 3. Video Management Features
- Preview videos directly in the dashboard
- Edit video metadata (title, description, order)
- Delete videos with confirmation
- Toggle active/inactive status
- Set featured video for product
- Show upload progress with percentage
- Handle upload errors gracefully

