### 2. Create Video Service
```typescript
// services/product-video.service.ts
@Injectable({
  providedIn: 'root'
})
export class ProductVideoService {
  private apiUrl = environment.apiUrl;

  constructor(private http: HttpClient) {}

  getProductVideos(productId: string): Observable<ProductVideo[]> {
    return this.http.get<ProductVideo[]>(
      `${this.apiUrl}/admin/products/${productId}/videos/`
    );
  }

  uploadVideo(productId: string, videoData: FormData): Observable<ProductVideo> {
    return this.http.post<ProductVideo>(
      `${this.apiUrl}/admin/videos/`,
      videoData
    );
  }

  updateVideo(videoId: string, data: Partial<ProductVideo>): Observable<ProductVideo> {
    return this.http.patch<ProductVideo>(
      `${this.apiUrl}/admin/videos/${videoId}/`,
      data
    );
  }

  deleteVideo(videoId: string): Observable<void> {
    return this.http.delete<void>(
      `${this.apiUrl}/admin/videos/${videoId}/`
    );
  }

  reorderVideos(productId: string, videoIds: string[]): Observable<void> {
    return this.http.post<void>(
      `${this.apiUrl}/admin/products/${productId}/videos/reorder/`,
      { video_ids: videoIds }
    );
  }
}
```

### 3. Create Video Upload Component
```typescript
// components/product-video-upload/product-video-upload.component.ts
@Component({
  selector: 'app-product-video-upload',
  templateUrl: './product-video-upload.component.html'
})
export class ProductVideoUploadComponent {
  @Input() productId!: string;
  @Output() videoUploaded = new EventEmitter<ProductVideo>();

  uploadProgress = 0;
  isUploading = false;

  onFileSelected(event: Event): void {
    const file = (event.target as HTMLInputElement).files?.[0];
    if (file) {
      this.uploadVideo(file);
    }
  }

  uploadVideo(file: File): void {
    const formData = new FormData();
    formData.append('video_file', file);
    formData.append('product', this.productId);
    // ... additional fields

    this.isUploading = true;
    this.videoService.uploadVideo(this.productId, formData)
      .subscribe({
        next: (video) => {
          this.videoUploaded.emit(video);
          this.isUploading = false;
        },
        error: (error) => {
          console.error('Upload failed:', error);
          this.isUploading = false;
        }
      });
  }
}
```

